import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.dataVal[0].title}
        amount={props.dataVal[0].amount}
        date={props.dataVal[0].date}
      />
    </div>
  );
}

export default Expenses;
